// carousel
document.addEventListener("DOMContentLoaded", function () {
    function initializeCarousel(carouselId) {
        const carousel = document.getElementById(carouselId);
        const holder = carousel.querySelector(`#${carouselId}-holder`);
        const items = Array.from(holder.querySelectorAll(".card"));
        const itemWidth = items[0].offsetWidth + 16; // Largeur d'un élément + marge droite
        const totalItems = items.length;

        // Calculer la largeur totale du conteneur
        const totalWidth = totalItems * 2 * itemWidth + "px";
        holder.style.width = totalWidth;

        let currentIndex = 0;

        function updateCarousel(direction) {
            currentIndex += direction;

            if (currentIndex >= totalItems) {
                currentIndex = 0;
                holder.style.transition = "none";
                holder.style.transform = `translateX(0px)`;
                setTimeout(() => {
                    holder.style.transition = "transform 0.5s ease";
                }, 20);
            } else if (currentIndex < 0) {
                currentIndex = totalItems - 1;
                holder.style.transition = "none";
                const resetOffset = -(currentIndex * itemWidth);
                holder.style.transform = `translateX(${resetOffset}px)`;
                setTimeout(() => {
                    holder.style.transition = "transform 0.5s ease";
                }, 20);
            } else {
                const offset = -(currentIndex * itemWidth);
                holder.style.transform = `translateX(${offset}px)`;
            }
        }

        // Fonctions pour les boutons
        window.prevSlide = function (carouselId) {
            const carousel = document.getElementById(carouselId);
            const holder = carousel.querySelector(`#${carouselId}-holder`);
            const itemWidth = holder.querySelector(".card").offsetWidth + 16;
            currentIndex -= 1;
            if (currentIndex < 0) {
                currentIndex = totalItems - 1;
                holder.style.transition = "none";
                const resetOffset = -(currentIndex * itemWidth);
                holder.style.transform = `translateX(${resetOffset}px)`;
                setTimeout(() => {
                    holder.style.transition = "transform 0.5s ease";
                }, 20);
            } else {
                const offset = -(currentIndex * itemWidth);
                holder.style.transform = `translateX(${offset}px)`;
            }
        };

        window.nextSlide = function (carouselId) {
            const carousel = document.getElementById(carouselId);
            const holder = carousel.querySelector(`#${carouselId}-holder`);
            const itemWidth = holder.querySelector(".card").offsetWidth + 16;
            currentIndex += 1;
            if (currentIndex >= totalItems) {
                currentIndex = 0;
                holder.style.transition = "none";
                holder.style.transform = `translateX(0px)`;
                setTimeout(() => {
                    holder.style.transition = "transform 0.5s ease";
                }, 20);
            } else {
                const offset = -(currentIndex * itemWidth);
                holder.style.transform = `translateX(${offset}px)`;
            }
        };

        // Initialiser le carousel
        updateCarousel(0);
    }

    // Initialiser tous les carousels sur la page
    initializeCarousel("carousel0");
    initializeCarousel("carousel1");
    initializeCarousel("carousel2");
    initializeCarousel("carousel3");
    initializeCarousel("carousel4");
    initializeCarousel("carousel5");
    initializeCarousel("carousel6");
    initializeCarousel("carousel7");
    initializeCarousel("carousel8");
    initializeCarousel("carousel9");
});

// Video playing
document.querySelectorAll(".card__cover").forEach(function (card) {
    card.addEventListener("mouseover", function () {
        var video = card.querySelector(".card__video");
        if (video) {
            video.play();
        }
    });

    card.addEventListener("mouseout", function () {
        var video = card.querySelector(".card__video");
        if (video) {
            video.pause();
            video.currentTime = 0; // Revenir au début de la vidéo
        }
    });
});

// Mobile carousel

function toggleAnswer(id) {
    const answer = document.getElementById(id);

    // Vérifie si la réponse est actuellement visible
    const isVisible = answer.style.display === "block";

    // Cacher toutes les réponses
    const answers = document.querySelectorAll(".faq-answer");
    answers.forEach((ans) => {
        ans.style.display = "none"; // Cacher toutes les réponses
    });

    // Enlever la classe 'bgadded' de toutes les questions
    const questions = document.querySelectorAll(".faq-question");
    questions.forEach((question) => {
        question.classList.remove("bgadded"); // Enlever la classe de toutes les questions

        // Réinitialiser l'image d'ouverture/fermeture
        const openImg = question.querySelector("#opendanswers");
        const closeImg = question.querySelector("#closeanswers");
        if (openImg && closeImg) {
            openImg.style.display = "block"; // Montrer l'image d'ouverture
            closeImg.style.display = "none"; // Cacher l'image de fermeture
        }
    });

    // Si la réponse n'est pas visible, on l'affiche et on ajoute la classe
    if (!isVisible) {
        answer.style.display = "block"; // Afficher la réponse
        const currentQuestion = answer.previousElementSibling; // La question est l'élément précédent
        currentQuestion.classList.add("bgadded"); // Ajouter la classe à la question cliquée

        // Changer l'image d'ouverture/fermeture
        const openImg = currentQuestion.querySelector("#opendanswers");
        const closeImg = currentQuestion.querySelector("#closeanswers");
        if (openImg && closeImg) {
            openImg.style.display = "none"; // Cacher l'image d'ouverture
            closeImg.style.display = "block"; // Montrer l'image de fermeture
        }
    }
}
