// paiements
document.addEventListener('DOMContentLoaded', function () {
    let plans = document.querySelectorAll('.payme');

    plans.forEach(plan => {
        plan.addEventListener('click', function (event) {
            // Vérifiez si l'utilisateur est connecté
            let isAuthenticated = this.getAttribute('data-authenticated') === 'true';
            let isAdmin = this.getAttribute('isadmin');

            if (!isAuthenticated) {
                // Afficher l'alerte de connexion
                let alertElement = document.getElementById('alertNonconected');
                alertElement.classList.add('alert', 'alert-danger');
                alertElement.style.display = 'block';

                setTimeout(() => {
                    alertElement.style.display = 'none';
                }, 4000);
                return; // Empêcher l'exécution du paiement
            }

            // vérifie si c'est l'admin qui est conneté
            if (isAdmin) {
                return; // Empêcher l'exécution du paiement
            }

            // Si l'utilisateur est connecté, procédez au paiement
            let plantype = this.getAttribute('plan');


            // Préparer les données à envoyer
            let paymentData = {
                plantype: plantype,
            };

            // Soumettre le formulaire avec une requête fetch
            fetch('/initpay', {
                method: 'POST',
                headers: {
                    'Content-Type': 'application/json',
                    'X-CSRF-TOKEN': document.querySelector('meta[name="csrf-token"]').getAttribute('content')
                },
                body: JSON.stringify(paymentData)
            }).then(response => response.json())  // Si vous attendez une réponse en JSON
                .then(data => {
                    if (data.success) {
                        // alerte d'initialisation de paiement
                        document.getElementById('alertNonconected').style.display = 'block';
                        document.getElementById('alertNonconected').classList.add('alert', 'alert-info');
                        document.getElementById('alertNonconected').innerHTML = data.message;

                        setTimeout(() => {
                            document.getElementById('alertNonconected').style.display = 'none';
                        }, 4000); // 4 secondes

                        setTimeout(() => {
                            window.location.href = data.checkout_url; // Redirigez vers l'URL de paiement 
                        }, 3000); // 3 secondes

                    } else if (data.error) {
                        // Affichez un message d'erreur si nécessaire
                        document.getElementById('alertNonconected').style.display = 'block';
                        document.getElementById('alertNonconected').classList.add('alert', 'alert-info');
                        document.getElementById('alertNonconected').innerHTML = data.message;

                        setTimeout(() => {
                            document.getElementById('alertNonconected').style.display = 'none';
                        }, 4000); // 4 secondes
                    }
                })
                .catch(error => {
                    document.getElementById('alertNonconected').style.display = 'block';
                    document.getElementById('alertNonconected').classList.add('alert', 'alert-danger');
                    document.getElementById('alertNonconected').innerHTML = error.message;

                    setTimeout(() => {
                        document.getElementById('alertNonconected').style.display = 'none';
                    }, 4000); // 4 secondes

                });

        });
    });
});
// end paiement

//carousel tendance
document.addEventListener("DOMContentLoaded", () => {
    const carousel = document.querySelector(".carousel");
    const leftButton = document.querySelector(".carousel-button.left");
    const rightButton = document.querySelector(".carousel-button.right");
    const itemWidth = document.querySelector(".carousel-item").offsetWidth + 30; // Largeur de l’item + la marge

    leftButton.addEventListener("click", () => {
        carousel.scrollBy({
            left: -itemWidth,
            behavior: "smooth"
        });
    });

    rightButton.addEventListener("click", () => {
        carousel.scrollBy({
            left: itemWidth,
            behavior: "smooth"
        });
    });
});


