// animation typscript abonnement page 
document.addEventListener('DOMContentLoaded', function () {
    var app = document.getElementById('animated-title');

    var typewriter = new Typewriter(app, {
        loop: true,
        delay: 75,
        cursor: "_", // Vous pouvez également modifier cela à votre guise
    });

    typewriter
        .typeString("Bienvenue sur nos plans d'abonnements,")
        .pauseFor(2000)
        .deleteAll()
        .typeString('Explorez nos forfaits,')
        .pauseFor(2000)
        .deleteAll()
        .typeString('Et profiter pleinement de nos services.')
        .pauseFor(2000)
        .start();
});
// fin typscript abonnement page 
// Fermer le menu mobile si clic en dehors du menu (max-width: 768px)
document.addEventListener('click', function (event) {
    const nav = document.querySelector('.header__nav');
    const btn = document.querySelector('.header__btn');
    if (!nav) return;

    // Vérifie si le menu est actif et si on est en mobile
    if (
        nav.classList.contains('header__nav--active') &&
        window.matchMedia('(max-width: 768px)').matches
    ) {
        // Si le clic n'est pas dans le menu ni dans le bouton qui l'ouvre
        if (!nav.contains(event.target) && !event.target.closest('.header__btn')) {
            nav.classList.remove('header__nav--active');
            document.body.classList.remove('body--active');
            if (btn) btn.classList.remove('header__btn--active');
        }
    }
});